import "../styles/stylesheet.css";

const Secrets = () => {
    
    const [secret, setSecret] = useState([]);

    return (
        <div className="scrt-div">
            <h2 className="scrt-hdr">Add your secret here and keep it secure.</h2>
            <div className="scrt-inpt-divs">
                <input className="scrt-inpt" type="text" placeholder="Type a secret" />
                <button className="scrt-add">Add</button>
            </div>
            <button className="logout">Log Out</button>
        </div>
    )
}

export default Secrets;
